--20000 PERSONAL CARDS 6 значний код унікальний (в передіку є і не унікальні) Пpоміжна табл всюди 0,забрала юнік

--- виялено 400 шт дублів ,видалимо
DELETE FROM Personal_Cards
WHERE Personal_Card IN
(SELECT Personal_Card FROM Personal_Cards
GROUP BY Personal_Card
HAVING COUNT(Personal_Card)>=2)

---додаю значення UNIQUE
ALTER TABLE Personal_Cards
ADD CONSTRAINT UC_Personal_Cards UNIQUE (Personal_Card)

--- прописуємо значення 1 якщо ІD є в таблиці з клієнтами
